// Dashboard.js

import React, { useState } from 'react';
import './Dashboard.css'; // Import your CSS file for Dashboard styles

const Dashboard = () => {
  const [showProductivity, setShowProductivity] = useState(false);

  const toggleProductivity = () => {
    setShowProductivity(!showProductivity);
  };

  return (
    <div className="dashboard-container">
      <img src="/logo2.png" alt="Logo" className="main-logo" />
      <img src="/logo3.png" alt="Secondary Logo" className="secondary-logo" />
      <h2 onClick={toggleProductivity} className="dashboard-heading">Employee Productivity Dashboard</h2>
      {showProductivity && (
        <div className="productivity-data">
          <p>Monday: 80%</p>
          <p>Tuesday: 75%</p>
          <p>Wednesday: 85%</p>
          <p>Thursday: 90%</p>
          <p>Friday: 85%</p>
          <p>Saturday: 70%</p>
        </div>
      )}
    </div>
  );
}

export default Dashboard;
